member.example:
    This example shows how to authenticate at Keeper server.

using System.Linq;
using System.Threading;
using System.Threading.Tasks;
using KeeperSecurity.Authentication;
using KeeperSecurity.Authentication.Async;
using KeeperSecurity.Configuration;

class AuthUi : IAuthUI
{
    public Task<bool> WaitForDeviceApproval(IDeviceApprovalChannelInfo[] channels, CancellationToken token)
    {
        // find email device approval channel.
        var emailChannel = channels
            .Cast<IDeviceApprovalPushInfo>()
            .FirstOrDefault(x => x.Channel == DeviceApprovalChannel.Email);
        if (emailChannel != null)
        {
            // invoke send email action.
            _ = Task.Run(async () =>
            {
                await emailChannel.InvokeDeviceApprovalPushAction();
            });
        }
        return new TaskCompletionSource<bool>().Task;
    }
    public async Task<bool> WaitForTwoFactorCode(ITwoFactorChannelInfo[] channels, CancellationToken token)
    {
        // find 2FA code channel.
        var codeChannel = channels
            .Cast<ITwoFactorAppCodeInfo>()
            .FirstOrDefault();
        if (codeChannel != null)
        {
            Console.WriteLine("Enter 2FA code: ");
            var code = Console.ReadLine();
            await codeChannel.InvokeTwoFactorCodeAction("code");
            return true;
        }
        return false;
    }
    public async Task<bool> WaitForUserPassword(IPasswordInfo info, CancellationToken token)
    {
        Console.WriteLine($"Enter password for {info.Username}: ");
        var password = Console.ReadLine();
        await info.InvokePasswordActionDelegate(password);
        return true;
    }
}

internal static class Program
{
    private static async Task Main()
    {
        var auth = new Auth(new AuthUi(), new JsonConfigurationStorage());
        await auth.Login("username@company.com");
    }
}

example.code:
using System.Linq;
using System.Threading;
using System.Threading.Tasks;
using KeeperSecurity.Authentication;
using KeeperSecurity.Vault;

internal static class Program
{
    private static async Task Main()
    {
        IAuthentication auth = await ConnectToKeeperAs("username@company.com");
        if (auth.AuthContext.IsEnterpriseAdmin)
        {
            // Load enterprise data.
            var enterprise = new EnterpriseData();
            var enterpriseLoader = new EnterpriseLoader(auth, new [] { enterprise });
            await enterpriseLoader.Load();

            // Find team with name "Google".
            var team = enterprise.Teams
                .FirstOrDefault(x => string.Compare(x.Name, "Google", StringComparison.InvariantCultureIgnoreCase) == 0);
            if (team == null)
            {
                // Create team.
                team = await enterprise.CreateTeam(new EnterpriseTeam
                {
                    Name = "Google",
                    RestrictEdit = false,
                    RestrictSharing = true,
                    RestrictView = false,
                });
            }
            // Add users to the "Google" team.
            await enterprise.AddUsersToTeams(
                new[] { "username@company.com", "username1@company.com" },
                new[] { team.Uid },
                Console.WriteLine);
        }
    }
}

using System.Linq;
using System.Threading;
using System.Threading.Tasks;
using KeeperSecurity.Authentication;
using KeeperSecurity.Vault;

internal static class Program
{
    private static async Task Main()
    {
        IAuthentication auth = await ConnectToKeeperAs("username@company.com");
        var vault = new VaultOnline(auth);
        Console.WriteLine("\nRetrieving records...");
        await vault.SyncDown();

        Console.WriteLine($"Hello {auth.Username}!");
        Console.WriteLine($"Your vault has {vault.RecordCount} records.");

        // Find record with title "Google"
        var search = vault.Records.FirstOrDefault(x => string.Compare(x.Title, "Google", StringComparison.InvariantCultureIgnoreCase) == 0);
        // Create a record if it does not exist.
        if (search == null)
        {
            search = new PasswordRecord
            {
                Title = "Google",
                Login = "/Account Name/",
                Password = "/Account Password/",
                Link = "https://google.com",
                Notes = "Stores google credentials"
            };
            search = await vault.CreateRecord(search);
        }

        // Update record.
        search.SetCustomField("Security Token", "11111111");
        search = await vault.UpdateRecord(search);

        // find file attachment.
        var attachment = search.Attachments
            .FirstOrDefault(x => string.Compare(x.Title, "google", StringComparison.InvariantCultureIgnoreCase) == 0);
        if (attachment == null)
        {
            // Upload local file "google.txt"
            var uploadTask = new FileAttachmentUploadTask("google.txt")
            {
                Title = "Google",
            };
            await vault.UploadAttachment(search, uploadTask);
        }
        else
        {
            // Download attachment into local file "google.txt"
            await using var stream = File.OpenWrite("google.txt");
            await vault.DownloadAttachment(search, attachment.Id, stream);

            // Delete attachment. Remove it from the record 
            search.Attachments.Remove(attachment);
            await vault.UpdateRecord(search);
        }

        // Find shared folder with name "Google".
        var sharedFolder = vault.SharedFolders
            .FirstOrDefault(x => string.Compare(x.Name, "Google", StringComparison.InvariantCultureIgnoreCase) == 0);
        if (sharedFolder == null)
        {
            // Create shared folder.
            var folder = await vault.CreateFolder("Google", null, new SharedFolderOptions
            {
                ManageRecords = true,
                ManageUsers = false,
                CanEdit = false,
                CanShare = false,
            });
            vault.TryGetSharedFolder(folder.FolderUid, out sharedFolder);
        }

        // Add user to shared folder.
        await vault.PutUserToSharedFolder(sharedFolder.Uid, "user@google.com", UserType.User, new SharedFolderUserOptions
        {
            ManageRecords = false,
            ManageUsers = false,
        });

        // Add record to shared folder.
        await vault.MoveRecords(new[] { new RecordPath { RecordUid = search.Uid } }, sharedFolder.Uid, true);
    }
}

member.summary:
possible value for userType
USER = 0;
ADMIN = 1;
ADMIN_HIDE_SHARED_FOLDERS = 2;
